import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";
class Landing extends Component {
  render() {
    return (
      <div style={{ width: "100%", margin: "auto" }}>
        <Grid className="landing-grid">
          <Cell col={12}>
            <img
              src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.shareicon.net%2Fwork-avatar-man-business-male-office-costume-106427&psig=AOvVaw1vZnOblJevnn5TOT8gOSHn&ust=1606241590388000&source=images&cd=vfe&ved=https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pinclipart.com%2Fpindetail%2FoRTimw_male-avatar-clipart%2F&psig=AOvVaw1vZnOblJevnn5TOT8gOSHn&ust=1606241590388000&source=https://cdn0.iconfinder.com/data/icons/avatars-6/500/Avatar_boy_man_people_account_client_male_person_user_work_sport_beard_team_glasses-512.png&cd=vfe&ved=0CAIQjRxqFwoTCOC1_K2ime0CFQAAAAAdAAAAABAN"
              alt="avatar"
              className="avatar-img"
            />
            <div className="banner-text">
              <h1>Full Stack Web Devloper</h1>
            </div>
          </Cell>
        </Grid>
      </div>
    );
  }
}
export default Landing;
